import logo from './images/logo.gif';
import './App.css';

export default function App() {
  return(
    <div className="snow">
    <div className="App">
      <header className="App-header">
        <img src={logo} alt="logo" className="App-logo"/>
        <h1>SkryxDev</h1><p className="App-link">Made using ReactJS</p>
      </header>
    </div>
    </div>
  )
};
